import React, { Component } from 'react';

class Text extends Component {
    render() {
        const { name, job } = this.props;
        return (
            <div>
                {this.props.name = 'hi'}
                <p>{`مرحباً يا ${name} وظيفتك هي ${job}`}</p>
            </div>
        );
    }
}

export default Text;
